package springGain.vo;

public class RafState {
	private String rafId;
	private String id;
	public RafState() {
		// TODO Auto-generated constructor stub
	}
	public RafState(String rafId, String id) {
		this.rafId = rafId;
		this.id = id;
	}
	public String getRafId() {
		return rafId;
	}
	public void setRafId(String rafId) {
		this.rafId = rafId;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	
}
